(734, 'OOA80222', '德科希娜 雅尔托利斯', 'FDV29758', 'Jimmy Thomas', '吉米托马斯见鬼了', '08/12/23', '我在圣丹尼见到三个鬼，堵在小巷口站成一排一动不动。我有些害怕，拿出枪保护自己，结果鬼逃跑了。我用套索套住了其中一个鬼，本想把他带到警局，但是他挣扎了下来，本着为民除害的正义念头，我开枪杀了这个鬼，但是警察怎么也不相信我，判过失杀人罪把我关进了监狱。出来后遇到了剩下两个鬼，我把他们活捉送到警官面前，但警官怎么也不相信我。在放跑了两个鬼之后，警官叫我快点离开这里。我很难过，觉得不是自己精神出了问题，只是警官看不见那两个鬼', '1', 1),
